//class based component as there is a state change depending
//on user's input

// input creates a textbox for us to use in App

class SearchBar extends React.Component {
  render() {
    return (
      <div>
        <form>
          <input type="text" />
        </form>
      </div>
    );
  }
}

export default SearchBar;
